?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Знаменитая компания по производству швейцарских часов Epos была образована в 1925 году. Самым главным человеком в истории компании считается Джеймс Обер, который на протяжении всей своей жизни пытался усовершенствовать часовые механизмы. Именно он стал основателем фабрики, которую все знают как центр производства часов. Весь свой накопленный опыт он передал Оберу и Фийону (своему зятю и племяннику). Уже потом, в своей мастерской, они создадут такие инновационные механизмы, как индикатор хода, «прыгающий час», показатель лунной фазы и даты. Все эти механизмы стремительно распространялись по всему миру, и, вскоре, стали очень популярны. В 80-е года, когда наступила эпоха кварцевых часов, только Петер Хофер сохранил преданность раритетным механизмам. И не зря. В 1983 году он создает свою компанию. Его преемниками, впоследствии, стали специалисты, которые неплохо разбирались во всех тонкостях часового искусства Тамди Чонге и Урсула Фостер. Именно под руководством Чонге и Фостер, с 2002 года, фирма Epos начинает выпуск необычных часов. И их выпуск продолжается до сих пор.</span></span></p>
 
